import React from 'react'

import { useEffect,useState } from 'react'
import axios from 'axios'
import Navbar from '../../navbar/Navbar';

//Axios to allow api request using react app

const CharacterDex = () => {

  const [characters,setCharacters] = useState();

  const options = {
    method: 'GET',
    url: 'https://naruto-database.p.rapidapi.com/clan',
    headers: {

      'X-RapidAPI-Key': '1ca38035f0msh18ec8cbd5d4b80ap1f90b7jsna99f26cfd310',
      'X-RapidAPI-Host': 'naruto-database.p.rapidapi.com',
      "User-Agent": "axios 0.21.1"
    }
  };

  useEffect(() =>{
    const fetchAllCharacters = async () =>{
      try {
        const response = await axios.request(options);
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    }
    fetchAllCharacters();
  },[])





  return (
    <div className="characterDexContainer">
      <div className="navbar">
        <Navbar/>
      </div>
      <div className="header">
        <h1>Characters</h1>
      </div>
      <div className="characterDexDescription">
        <p>Search and look through all characters in the naruto universe!</p>
      </div>
      <div className="charactersContainer">
        <div className="characterBox"></div>
      </div>
    </div>
  )
}

export default CharacterDex
